tables.table_schema:
CREATE TABLE historical_prices (
   id INT PRIMARY KEY,
   symbol VARCHAR(255) NOT NULL,
   date DATE NOT NULL,
   price FLOAT NOT NULL
);

CREATE TABLE training_data (
   id INT PRIMARY KEY,
   symbol VARCHAR(255) NOT NULL,
   features JSONB NOT NULL,
   label FLOAT NOT NULL
);

CREATE TABLE historical_prices (
    id SERIAL PRIMARY KEY,
    symbol VARCHAR(255) NOT NULL,
    date DATE NOT NULL,
    price DECIMAL NOT NULL
);

CREATE TABLE machine_learning_models (
    model_id SERIAL PRIMARY KEY,
    model_name VARCHAR(255) NOT NULL,
    description TEXT,
    created_at TIMESTAMP DEFAULT NOW()
);

CREATE TABLE trading_algorithms (
    algorithm_id SERIAL PRIMARY KEY,
    algorithm_name VARCHAR(255) NOT NULL,
    accuracy DECIMAL,
    last_updated TIMESTAMP
);

CREATE TABLE trading_algorithm (
    algorithm_id INT,
    algorithm_name VARCHAR(50),
    author VARCHAR(50),
    description TEXT
);

CREATE TABLE machine_learning_model (
    model_id INT,
    model_name VARCHAR(50),
    model_type VARCHAR(50),
    training_data_table VARCHAR(50)
);

CREATE TABLE trading_strategy (
    strategy_id INT,
    strategy_name VARCHAR(50),
    description TEXT,
    performance_metric DECIMAL(10, 2)
);

CREATE TABLE models (
  model_id SERIAL PRIMARY KEY,
  model_name VARCHAR(100) NOT NULL,
  created_at TIMESTAMP NOT NULL
);

CREATE TABLE algorithm_parameters (
  parameter_id SERIAL PRIMARY KEY,
  model_id INT NOT NULL,
  param_name VARCHAR(50) NOT NULL,
  param_value FLOAT NOT NULL
);

CREATE TABLE user_roles (
  user_id SERIAL PRIMARY KEY,
  role_name VARCHAR(50) NOT NULL
);
